import React from "react";

import "./Card.css";
import Cover from "../Pictures/HD.png";
import Hi from "../Pictures/hi1.png";
import Hi2 from "../Pictures/hi (2).png";

function Card() {
  return (
    <>
      <div className="page background">
            <div className="name">
               <div className="box">
                    <div>
                    <div className="multicolor-text">
                        Hi!<br></br> 
                        I'm Khushboo Singh. 
                    </div>
                    <br></br>
                    <p className="info">A front-end developer and general doodler who is not ready to put the crayon down.</p>
                    </div>
                    <img className="welcomeImage" src={Hi} alt="Cover_Picture" />
                    <img className="welcomeImage" src={Hi2} alt="Cover_Picture" />
                </div>
            </div>
        
        <div className="container">
            <img className="cover" src={Cover} alt="Cover_Picture" />
        </div>
      </div>
    </>
  );
}

export default Card;
